import React, { useState, useEffect } from 'react'
import { Link, useHistory } from 'react-router-dom'
import { FiPower,FiMessageSquare, FiTrash2,FiSearch } from 'react-icons/fi'

import api from '../../services/api'

import './styles.css'

import logoImg from '../../assets/logo.svg'

export default function Profile() {

  const [restaurante, setRestaurante] = useState([])
  const history = useHistory()
  const restauranteId = localStorage.getItem('id')
  const nomeUsuario = localStorage.getItem('userName');
  const [termoPesquisa, setTermoPesquisa] = useState('');
  const [typeOfFood, setTypeOfFood] = useState('');
  const [opcoesTipoComida, setOpcoesTipoComida] = useState([]); // Estado para armazenar as opções do dropdown


  const realizarPesquisa = async () => {
    try {
      if (termoPesquisa.trim() !== '') {
        const response = await api.get(`/restaurantes/search?name=${termoPesquisa}`, {
          headers: {
            Authorization: restauranteId,
          }
        });
        setRestaurante(response.data);
      } else {
        const response = await api.get('restaurante', {
          headers: {
            Authorization: restauranteId,
          }
        });
        setRestaurante(response.data);
      }
    } catch (error) {
      // Trate erros, se houver algum
    }
  };

 
  const buscarRestaurantes = async () => {
    try {
      // Realize a chamada à API para buscar restaurantes com base no tipo de comida
      // Você pode passar tipoComida como um parâmetro na chamada da API
      const response = await api.get(`/restaurantes/search?typeOfFood=${typeOfFood}`);
      setRestaurantes(response.data);
    } catch (error) {
      // Trate erros, se houver algum
    }
  };

  // Função para buscar as opções do dropdown a partir da base de dados
  const buscarOpcoesTipoComida = async () => {
    try {
      // Realize a chamada à API para buscar as opções de tipos de comida
      const response = await api.get('/restaurante');
      setOpcoesTipoComida(response.data.typeOfFood);
    } catch (error) {
      // Trate erros, se houver algum
    }
  };

  // Use o useEffect para buscar as opções do dropdown quando o componente for montado
  useEffect(() => {
    buscarOpcoesTipoComida();
  }, []);

  // Use o useEffect para acionar a busca de restaurantes quando o tipo de comida selecionado mudar
  useEffect(() => {
    if (typeOfFood.trim() !== '') {
      buscarRestaurantes();
    } else {
      // Se o tipo de comida estiver vazio, você pode realizar outra ação apropriada, como mostrar todos os restaurantes.
    }
  }, [typeOfFood]);

  // Use o useEffect para acionar a pesquisa quando termoPesquisa ou restauranteId mudar
  useEffect(() => {
    realizarPesquisa();
  }, [termoPesquisa, restauranteId]);



  // async function handleDeleteIncident(id) {
  //   try {
  //     await api.delete(`restaurante/${id}`, {
  //       headers: {
  //         Authorization: restauranteId,
  //       }
  //     })
      
  //     setRestaurante(restaurante.filter(incident => incident.id !== id))
  //   } catch (err) {
  //     alert('Erro ao deletar caso, tente novamente.')
  //   }
  // }

  function handleComent(id){
    history.push(`/comentario/${id}`);
  }    



  function handleLogout() {
    localStorage.clear()
    history.push('/')
  }

  return (
    <div className="profile-container">
      <header>
        <img src={logoImg} alt="Be The Hero" />
        <span> Bem-vindo/a, {nomeUsuario} </span>
      

        {/* <Link className="button" to="/incidents/new"> Cadastrar novo caso </Link> */}
        
        <select
        value={typeOfFood}
        onChange={(e) => setTipoComida(e.target.value)}
      >
        <option value="">Selecione o tipo de comida</option>
        {opcoesTipoComida.map((opcao) => (
          <option key={opcao.id} value={opcao.typeOfFood}>
            {opcao.typeOfFood}
          </option>
        ))}
      </select>


          <input
            type="text"
            placeholder="Pesquisar Restaurante"
            value={termoPesquisa}
            onChange={(e) => setTermoPesquisa(e.target.value)}
          />          
           <button onClick={handleLogout} type="button">
          <FiPower size={18} color="e02041" />
        </button>
      </header>
      <h1> Restaurantes </h1>
      <ul>
        {restaurante.map(restaurante => (
          <li key={restaurante.id}>
            <strong> Nome do Restaurante: </strong>
            <p> {restaurante.name} </p>
         
            <strong> Tipo de cozinha: </strong>
            <p> {restaurante.typeOfFood} </p>

            <strong> Local: </strong>
            <p> {restaurante.place} </p>
            
            <strong> Horario: </strong>
            <p> {restaurante.horario} </p>

            <strong> Contacto: </strong>
            <p> {restaurante.contact} </p>
    
           {/* <strong> VALOR Medio: </strong> */}
            {/* <p> {Intl.NumberFormat('pt-Mz', { style: 'currency', currency: 'MZN' }).format(incident.value)} </p> */}
    
            {/* <button onClick={() => handleDeleteIncident(restaurante.id)} type="button">
              <FiTrash2 size={20} color="#a8a8b3" />
            </button> */}
            <button onClick={() => handleComent(restaurante.id)} type="button">
              <FiMessageSquare size={20} color="#a8a8b3" />
            </button>
          </li>
        ))}
      </ul>
    </div>
  )
}
